        <td className="">{tasks}</td>
        <td className="">Cell</td>
        <td className="">
          <div className="edit">
            <button className="ui yellow button">Revise</button>
            <button className="ui black button">Delected</button>
          </div>
        </td>
      </tr>
    );
  }
}

export default List;
